DECLARE 
    V_EXIST NUMBER;
BEGIN
    SELECT COUNT(*)
      INTO V_EXIST
      FROM USER_TABLES
     WHERE TABLE_NAME = 'ORDERS';

    IF V_EXIST <> 0 THEN
        EXECUTE IMMEDIATE 'DROP TABLE ORDERS CASCADE CONSTRAINT PURGE';
    END IF;

    SELECT COUNT(*)
      INTO V_EXIST
      FROM USER_SEQUENCES
     WHERE SEQUENCE_NAME = 'SEQ_ORDERS';

    IF V_EXIST <> 0 THEN
       EXECUTE IMMEDIATE 'DROP SEQUENCE SEQ_ORDERS'; 
    END IF;
END;
/

CREATE TABLE ORDERS (
    ORDER_ID          NUMBER(10,0) NOT NULL, 
    CUSTOMER_ID       CHAR(5), 
    EMPLOYEE_ID       NUMBER(10,0), 
    ORDER_DATE        DATE,
    REQUIRED_DATE     DATE,
    SHIPPED_DATE      DATE, 
    SHIP_VIA          NUMBER(10,0), 
    FREIGHT           NUMBER(19,4) DEFAULT 0, 
    SHIP_NAME         VARCHAR2(40), 
    SHIP_ADDRESS      VARCHAR2(60), 
    SHIP_CITY         VARCHAR2(15), 
    SHIP_REGION       VARCHAR2(15), 
    SHIP_POSTAL_CODE  VARCHAR2(10),
    SHIP_COUNTRY      VARCHAR2(15), 
    CONSTRAINT PK_ORDERS PRIMARY KEY(ORDER_ID),
    CONSTRAINT FK_ORDERS_CUSTOMER_ID FOREIGN KEY (CUSTOMER_ID) REFERENCES CUSTOMERS(CUSTOMER_ID), 
    CONSTRAINT FK_ORDERS_EMPLOYEE_ID FOREIGN KEY(EMPLOYEE_ID) REFERENCES EMPLOYEES(EMPLOYEE_ID), 
    CONSTRAINT FK_ORDERS_SHIP_VIA FOREIGN KEY(SHIP_VIA) REFERENCES SHIPPERS(SHIPPER_ID)
);

CREATE INDEX IDX_ORDERS_CUSTOMER_ID ON ORDERS(CUSTOMER_ID);

CREATE INDEX IDX_ORDERS_EMPLOYEE_ID ON ORDERS(EMPLOYEE_ID);

CREATE INDEX IDX_ORDERS_ORDER_DATE ON ORDERS(ORDER_DATE);

CREATE INDEX IDX_ORDERS_SHIPPED_DATE ON ORDERS(SHIPPED_DATE);

CREATE INDEX IDX_ORDERS_SHIP_VIA ON ORDERS(SHIP_VIA);

CREATE INDEX IDX_ORDERS_SHIP_POSTAL_CODE ON ORDERS(SHIP_POSTAL_CODE);

CREATE SEQUENCE SEQ_ORDERS MINVALUE 10248;

CREATE OR REPLACE TRIGGER TRI_ORDERS_AUTO_INCREMENT
BEFORE INSERT ON ORDERS
FOR EACH ROW
BEGIN
    IF :NEW.ORDER_ID IS NULL THEN
        SELECT SEQ_ORDERS.NEXTVAL 
            INTO :NEW.ORDER_ID 
          FROM DUAL;
    END IF;
END;
/

ALTER TABLE ORDERS DISABLE CONSTRAINT FK_ORDERS_CUSTOMER_ID;
ALTER TABLE ORDERS DISABLE CONSTRAINT FK_ORDERS_EMPLOYEE_ID;
ALTER TABLE ORDERS DISABLE CONSTRAINT FK_ORDERS_SHIP_VIA;

-- 10248 ~ 11077

ALTER TABLE ORDERS ENABLE CONSTRAINT FK_ORDERS_CUSTOMER_ID;
ALTER TABLE ORDERS ENABLE CONSTRAINT FK_ORDERS_EMPLOYEE_ID;
ALTER TABLE ORDERS ENABLE CONSTRAINT FK_ORDERS_SHIP_VIA;